import React, { Component } from 'react';
import {
  Modal,
  ButtonGroup,
  Button
} from 'react-bootstrap';
import CreatePoll from'./CreatePoll';


class ModalCreatePoll extends Component{
  constructor(props) {
    super(props);
  }


  render() {
    return (
      <>
      <Modal
      {...this.props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
        <Modal.Title id="contained-modal-title-vcenter">
          Create Poll
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>

        <CreatePoll onHide={this.props.onHide} />

      </Modal.Body>
    </Modal>
      </>
    );
  }
};

export default ModalCreatePoll;
